import React from "react";
import "./style.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faMoneyBillAlt,
  faHourglassEnd,
  faUser,
  faHandshake,
  faPuzzlePiece,
  faUserTimes,
} from "@fortawesome/free-solid-svg-icons";
function Component_NgangXanh() {
  return (
    <div>
      <div className="box">
        <div>
          <div style={{ display: "flex", justifyContent: "center" }}>
            <div className="icon-hover">
              <FontAwesomeIcon
                icon={faHourglassEnd}
                size="3x"
                color="#007c7e"
              />
            </div>
          </div>
          <div style={{ display: "flex", justifyContent: "center" }}>
            <div className="topic-com">Thời gian</div>
          </div>
          <div className="content-com">Bạn tốn thời gian cho việc giám sát, quản lý cơ sở, khác thuê, chi phí</div>

        </div>
      </div>
    </div>
  );
}

export default Component_NgangXanh;
